import logo from './logo.svg';
import './App.css';
import Dashbord from './layouts/Dashbord';
import 'semantic-ui-css/semantic.min.css'
import { Container } from 'semantic-ui-react';

function App() {
  return (
    <div className="App">
      <Container className="main">
      <Dashbord />
</Container>
    </div>
  );
}

export default App;
